const CommunityItem = () => {
  return (
    <div className="CommunityItem">
      <div>커뮤니티 사진: {it.community_picture}</div>
      <div>커뮤니티 이름 : {it.community_name}</div>
      <div>커뮤니티 결제 허용 : {it.community_allow}</div>
    </div>
  );
};

export default CommunityItem;
